import React, {useState} from 'react'

function Deleteme() {

    const [state, setstate] = useState(1)

const test = (key) => {
    switch (key) {
        case 0:
            let test1 = <h1>something</h1>
            break;
        case 1:
            let test2 = <h1>this is from case2</h1>
            break;
        default:
            break;
    }
}

    return (
        <div>
           {
               {
                    0:<h1>test</h1>,
                    1:<h1>test2</h1>
               }[{state}]
           }
           <h1>test</h1>
           <h1>{state}</h1>
           {test({state})}
        </div>
    )
}

export default Deleteme
